import React from "react";

import Navbar from "./Navbar";
import Header from "./Header";
import Footer from "./Footer";
import styles from "./Layout.module.css";

const Layout = (props) => {
    return (
        <div className={styles.container}>
            <Navbar />
            <main>
                <Header />

                {props.children}
            </main>
            <Footer />
        </div>
    );
};

export default Layout;
